INSERT INTO `fs_note_field` VALUES (528501,'<img src=\"http://news.xinhuanet.com/finance/2010-02/05/xinsrc_4420207051423171232418.jpg\" style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; border: 0px; width: 520px; max-height: 520px; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" /><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">網路開店真的那麼簡單？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">很多業者都以為架設網路商店很簡單，只要網路商店開張了，自然就會有訂單流進來，直到購物網站架設好了，才發現購物網站竟然只有少少的訂單，是購物網站不好做嗎？當然不是，是業者對網路的行銷模式和經營經驗不足。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">其實開一間購物網站與開一間實體店面是一樣的道理，若是租了一間在深山裡、無人知曉的店面，每個月的人流肯定很稀疏，但若是一間每個月20萬元租在台北市西門町的實體店面，每個月自然有大量的人流，網路開店也是同理，在網路上架設一間網路商店，就如同開一間實體店面一般，只要網站每個月撥出一定的行銷預算，就會有一定的人流，而且網路上的人流比起實體店面的人流更容易創造，網路商店的行銷預算性價比也較實體店面更高，但絕不是想像中的「只要架設購物網站就有訂單」那麼簡單。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">網路上的免費開店平台真的是零成本嗎？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">有些人認為架設購物網站是零成本的生意，雖然架設購物網站的成本相對實體店面要低得多，但抱持著零成本的心態經營，是絕對不會有好收穫的，網路上有不少號稱零成本的開店平台，但這些號稱零成本的平台仍然需要收取廣告費、交易費、空間費等費用，而在這種免費平台中販售產品的業者，若是沒有每個月花費少則數千元、多則數十萬元的廣告費用，那麼消費者要搜尋到未付廣告費的產品，就像是在大海裡撈針，產品永遠石沉大海、乏人問津。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">因此只要稍有知名度的企業，多是選擇開發獨立的購物網站，而非與一群競爭激烈的個人店家在免費的購物平台攪和，擁有獨立的會員系統是一項重要的因素，對於業者來說，花了大筆廣告預算好不容易觸及到的消費者，不該僅有一次性的消費，而必須盡可能留下會員資料，並以電子報、社群功能等使消費者重複購物，為購物網站後續產生更多持續性的獲利。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">除了擁有獨立的會員系統、獨立的金流系統以外，最重要的是免費平台僅有平台的使用權，而非擁有該平台的所有權，因此就算花費大筆鈔票真的在免費平台上做出了口碑，後續想要架設自己的購物網站，就像是擺路邊攤的攤販改為店面經營一樣，一旦轉換平台便會流失大量既有的消費者，且會員資料必須全部從零開始累積，為了省錢而使用免費平台，反而在省錢的過程中繞了一大圈。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">架設購物網站會有哪些費用？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">開設網路商店在初期會花到的費用有購物網站的開發費用、網路行銷費用、人員薪資等等，而開發一個購物網站就像是為一間實體店面裝潢一樣，購物網站的設計好壞，有非常大的比例影響到一個消費者的購物決定，也進而影響到購物網站的營業收入，雖然開發一個功能齊全的獨立購物網站，至少需要二十萬元以上的開發預算，且若是希望購物網站具有質感或是與眾不同的系統設計，更會因為業者的需求，可能花上幾十萬元、上百萬元以上的價格。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">坊間仍有業者喊出開發費用只要十萬元以下的獨立購物網站，但這些號稱十萬元以下的購物網站，絕大多數都是假的獨立購物網站，這些購物網站看似擁有不同的外觀，然而對於網站資料庫、會員系統等卻沒有所有權，一切資料和所有權等重要的權力仍然在開發公司手上。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">除了購物網站的開發成本，另一個影響購物網站成敗的重要因素則是網路行銷，網路行銷的預算隨業者的行銷策略會有不同的成本，通常以購買廣告刊版、關鍵字廣告而有不等的費用，也有的業者以舉辦活動搭配贈品的方式行銷，而網路行銷講求的是創意，只要能利用創意吸引消費者的注意力，即使僅有少少的行銷預算，也有可能為購物網站創造一夕之間爆紅的可能性。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">比起實體店面，購物網站的優勢在哪裡？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">庫存壓力：實體店面&gt;購物網站（大至小）</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">消費者觸及率：購物網站&gt;實體店面（多至少）</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">行銷工具：購物網站&gt;實體店面（多至少）</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">統計資料：購物網站&gt;實體店面（多至少）</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">電子商務這種東西看似簡單，卻又有不少智慧藏在裡頭，比起實體店面，購物網站少了實體店面的庫存壓力，甚至一個購物網站就能夠觸及世界各地的消費者，除了不會受到區域性的限制，在行銷工具的操作選擇上也更多，而且還能透過更多的科學統計，來計算消費者的來客率和購買轉換率，比起實體店面還是有相當大的優勢，但要如何正確的操作這些資源，就要仰賴業者能否確實瞭解網路產業的相關資訊，時時刻刻將資訊保持在最尖端，才能確保不被變化快速的網路市場給淘汰。</span>'),(528502,'<img src=\"http://www.artdes.monash.edu.au/design/assets/design_courses_communication.jpg\" style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; border: 0px; width: 520px; max-height: 520px; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" /><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">投資必備的條件是金錢？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">在這個升職加薪不易的年代，我們都知道光是上班賺錢、存錢是很難達到財務自由的，而投資則是致富最好的管道之一，但許多人提及「投資」這個名詞時，想到的總是「投資不是我玩得起的」因為「需要很多錢」，然而投資最重要的條件真的是錢嗎？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">根據美國的統計，中樂透獲得大筆獎金的樂透富翁，平均在五年以內會把獎金花光，而且許多人的生活反而變得比中樂透之前更糟糕，先不論這些樂透富翁到底是怎麼花錢的，在這個統計之中最值得注意的應該是「為什麼一般人留不住大筆的樂透獎金？」，因為這些中樂透的樂透富翁，並不具備投資理財的知識和心理素質，他們總是搞不清楚投資和支出的差別，也分不出機會和風險的差異性，即使理財專員告知他們可能賺錢的投資機會，他們也不具備辨識機會和風險的能力，還可能弄巧成拙，錯把風險當作機會、把支出當作投資，最後當然就是大筆大筆的把鈔票全部消耗殆盡了。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">不花錢也可以投資嗎？</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">如果手上沒有現金投資別人的公司，若是具備足夠的知識、經驗、人脈，即使不需要任何金錢也可以投資，只要擁有足夠的能力，不但不必投資別人的公司，甚至還可以讓別人抱著鈔票投資自己的公司，當然前提是必須具備讓人信任這間公司的條件，例如：一款創新的產品、一個獨家的技術、一份具潛力的創業企劃書。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">任何投資都是有風險的，也因為比別人多承擔了風險，才會有豐厚的報酬，雖然投資者不可能將風險控制為零，但厲害的投資者卻能透過知識、經驗、人脈了解每一個投資的風險高低，並且把投資風險控制在容許的範圍內，因此我們能說，投資賺不賺錢，最重要的重點並不在於「手上有多少錢」，而是在於「專業能力」和「投資眼光的精準度」。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">[size=150]投資別人之前，必須先投資自己[/size]</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">投資並非僅指金融證券、房地產上的有形體的投資，真正的投資應該在於知識、經驗、人脈上的無形投資，只有累積足夠的知識、經驗和人脈，才有可能透過投資賺錢，甚至讓人們跟著自己投資。</span><br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<br style=\"font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; color: rgb(85, 85, 85); font-size: 15px; line-height: 30px;\" />\r\n<span style=\"color: rgb(85, 85, 85); font-family: \'Noto Sans CJK TC\', \'LiHei Pro\', 儷黑體, sans-serif; font-size: 15px; line-height: 30px;\">人生是一條不斷面臨投資選擇的岔路，當我們選擇閱讀的書籍時屬於知識的投資，當我們在做每一件不同的工作時是經驗的投資，當我們在跟不同的朋友握手的時候則是人脈的投資，首先拋開「投資不是我玩得起的」的觀念，在腦海中劃出一條屬於自己的、清晰的道路，時時刻刻告訴自己「現在我做的事，決定我五年以後過的生活」，想要在未來的某一天能夠獲得財務自由，不但要走出自己的舒適圈，還要勇敢的投資自己。</span>'),(528731,''),(528730,''),(528729,''),(528728,''),(528727,''),(528726,''),(528725,''),(528724,''),(528723,''),(528722,''),(528721,''),(528720,''),(528719,''),(528718,''),(528717,''),(528716,''),(528715,''),(528714,''),(528713,''),(528712,''),(528711,''),(528710,''),(528709,''),(528708,''),(528707,''),(528706,''),(528705,''),(528704,''),(528703,''),(528702,''),(528701,''),(528700,''),(528699,''),(528698,''),(528697,''),(528696,''),(528695,''),(528694,''),(528693,''),(528692,''),(528617,''),(528691,''),(528690,''),(528689,''),(528688,''),(528687,''),(528686,''),(528685,''),(528684,''),(528683,''),(528682,''),(528681,''),(528680,''),(528679,''),(528678,''),(528677,''),(528676,''),(528675,''),(528674,''),(528673,''),(528672,''),(528671,''),(528670,''),(528669,''),(528668,''),(528667,''),(528666,''),(528665,''),(528664,''),(528663,''),(528662,''),(528661,''),(528660,''),(528659,''),(528658,''),(528657,''),(528656,''),(528655,''),(528654,''),(528653,''),(528652,''),(528651,''),(528650,''),(528649,''),(528648,''),(528647,''),(528646,''),(528645,''),(4,''),(3,''),(2,''),(1,''),(528644,''),(528509,''),(528643,''),(528642,''),(528641,''),(528640,''),(528639,''),(528638,''),(528637,''),(528636,''),(528635,''),(528634,''),(528633,''),(528632,''),(528631,''),(528630,''),(528629,''),(528628,''),(528627,''),(528626,''),(528625,''),(528624,''),(528623,''),(528732,''),(528733,''),(528734,''),(528735,''),(528736,''),(528737,''),(528738,''),(528739,''),(528740,''),(528741,''),(528742,''),(528743,''),(528744,''),(528745,''),(528746,''),(528747,''),(528748,''),(528749,''),(528750,''),(528751,''),(528752,''),(528753,''),(528754,''),(528755,''),(528756,''),(528757,''),(528758,''),(528759,''),(528760,''),(528761,''),(528762,''),(528763,''),(528764,''),(528765,''),(528766,''),(528767,''),(528768,''),(528769,''),(528770,''),(528771,''),(528772,''),(528773,''),(528774,''),(528775,''),(528776,''),(528777,''),(528778,''),(528779,''),(528780,''),(528781,''),(528782,''),(528783,''),(528784,''),(528785,''),(528786,''),(528787,''),(528788,''),(528789,''),(528790,''),(528791,''),(528792,''),(528793,''),(528794,''),(528795