00:00:00',0,2,1),(33,11,528506,'(瘋沃)公司內部修正','1.作品集網站修改<br />\n<a href=\"http://web.fanswoo.com/ipix\" rel=\"noreferrer\" target=\"_blank\">web.fanswoo.com/ipix</a><br />\n內文換成 GoPro 簡介，不要有租賃的字眼<br />\nLOGO換成 GoPro<br />\n上產品上滿一頁<br />\n<br />\n2.作品集網站修改<br />\n<a href=\"http://web.fanswoo.com/paris_strawberry\" rel=\"noreferrer\" target=\"_blank\">web.fanswoo.com/paris_strawberry</a><br />\n產品內頁的廣告圖也換成目前產品首頁的廣告圖<br />\n內文不要是英文，換成巴黎草莓的簡介<br />\n首頁的文章之類的版面從後台上架把空白處填滿<span style=\"color:#008000\"><em>(已完成)</em></span><br />\n<br />\n<br />\n<br />\n3.作品集的購物網站區塊刪除187法式、Solnine<br />\n作品集的形象網站區塊新增京城銀行、吳老師冰品<span style=\"color:#008000\"><em>(已完成)</em></span><br />\n<br />\n4.所有web上面的作品集，的資料夾名稱改為網站名字，例如：<a href=\"http://web.fanswoo.com/alchema\" rel=\"noreferrer\" target=\"_blank\">web.fanswoo.com/alchema</a>&nbsp;改成<br />\n<a href=\"http://web.fanswoo.com/alchema.com\" rel=\"noreferrer\" target=\"_blank\">web.fanswoo.com/alchema.com</a><br />\n（以後不開放<a href=\"http://web.fanswoo.com/\" rel=\"noreferrer\" target=\"_blank\">web.fanswoo.com</a>供客戶修改，客戶測試用的改成<a href=\"http://test.fanswoo.com/\" rel=\"noreferrer\" target=\"_blank\">test.fanswoo.com</a>）<span style=\"color:#008000\"><em>(已完成)</em></span><br />\n<br />\n5.處理完以後，所有<a href=\"http://web.fanswoo.com/\" rel=\"noreferrer\" target=\"_blank\">web.fanswoo.com</a>下面的作品集和mysql.sql都備份一份到設計資料夾裡面 &nbsp;<span style=\"color:#008000\"><em>(已完成)<br />\n<br />\n<br />\n--------------------------------------------------------------------------------------------------------------</em></span><br />\n<br />\n<span style=\"color:#B22222\">*文章系統尚有問題<br />\n文章套件符號無法顯示，但仍可使用</span><br />\n&nbsp;','18',100,16,16,'2016-09-01 00:00:00','2016-09-02 00:00:00',0,2,1),(34,7,528509,'(瘋沃)官網修改','官網問題修正','18',100,8,12,'2016-09-01 00:00:00','2016-09-02 00:00:00',0,2,1),(35,2,528506,'(長安)圖稿內頁風格修改~完成','8/30 &nbsp;郵件內容<br />\n金底的最新消息頗受好評，比倒三角更獲青睞<br />\n這部份同事好奇會怎麼動態呈現<br />\n<br />\n各國行程應該是不需要Read More<br />\n老闆偏好五角形盾牌版本<br />\n<br />\n但藍底方框加上五角形，幾何圖形多，建議單純化<br />\n三層圖層（底、中底、盾牌）可以變兩層（底、盾牌）<br />\n<br />\n各國旅遊底部傾向不用海岸照片<br />\n<br />\n訂閱電子報那區的圖是可以更換的嗎？或是有搭上動態效果？<br />\n（單純問問確認）\n<p>感謝<br />\n-----------------------------------------------------------------<br />\n風格應該就是確定寶藍色的了<br />\n所以需要調整內頁~<br />\n特別注意國家頁~形成業及靈魂頁~把我們之前討論的UI/UX加進去<br />\n<br />\n忘記的話我們再討論</p>\n','11',0,16,0,'2016-09-05 00:00:00','2016-09-06 00:00:00',0,0,-1),(36,10,528507,'(君綺)活動頁面圖稿','完成活動葉面圖稿','11',100,24,23,'2016-09-08 00:00:00','2016-09-12 00:00:00',0,2,1),(37,7,528509,'(京城)部分問題修正','account_page_result02的部分，若是C規則會在結果頁多顯示金額(最多9碼)，<br />\ncompany的index與view，<br />\n手機版的輪播圖比起個人服務偏窄，<br />\n(因為圖片本身大小限制就不一樣)<br />\n二層分類的說明區塊不希望有太多留白，<br />\n(不留白的部分可以考慮把圖片長寬縮小, 就可以使下方空白減少, 但圖片會比較不清楚, 另外要注意每一個區塊大小必須相同)<br />\n這些部分都有再做調整，<br />\n若有較好的寫法再麻煩建議，謝謝～<br />\n&nbsp;','12',0,2,0,'2016-09-05 00:00:00','2016-09-05 00:00:00',0,0,-1),(38,7,528505,'(京城)搜尋修正','他們提到<br />\n1.搜尋不到 公告專區 跟菁英招募的訊息<br />\n2.搜尋 保險 &nbsp; 只會出現人壽保險 &nbsp;不會出現財產保險<br />\n<br />\n<span style=\"color:#008000\">※ 搜尋標題改成搜尋內容<br />\n搜尋菁英招募的頁面 若有更改大項目名稱（會影響搜尋結果） 請自行修改 view/search/index.php<br />\n修改先依照目前京城銀行菁英招募中的項目做，目前若搜尋條件符合會顯示的搜尋結果：<br />\n&lt;a href=&quot;seek/?block=seek&quot;&gt;▪ 菁英招募&lt;/a&gt;<br />\n&lt;a href=&quot;seek/?block=seek2&quot;&gt;▪ 校園徵才&lt;/a&gt;<br />\n&lt;a href=&quot;seek/?block=seek3&quot;&gt;▪ 焦點職缺&lt;/a&gt;<br />\n&lt;a href=&quot;seek/?block=seek4&quot;&gt;▪ 體檢項目&lt;/a&gt;</span>','17',100,2,2,'2016-09-05 00:00:00','2016-09-05 00:00:00',0,2,1),(39,5,528505,'(幻域)迅航金流串接','智付寶我來串<br />\n你試一試上網看他們API文件串金流~有問題都可以一起討論<br />\n暫時排3天~','17',0,24,0,'2016-10-24 00:00:00','2016-10-25 00:00:00',0,0,1),(40,11,528509,'(千翔)動態頁面跑版修正','動態頁面跑版修正','12',100,1,2,'2016-09-05 00:00:00','2016-09-05 00:00:00',0,2,1),(41,11,528509,'(瘋沃)官網頁面修正','1. 官網首頁下方的輪播，標題、副標題、簡介的間距調整一下，現在這樣看起來很奇怪<br />\n2. header_bar 最下方的 contact 的第一個字沒有變顏色，感覺怪怪的<br />\n3. 聯繫單最下面的 textarea 離上方的 input 太近了<br />\n4. 作品集的手機版補上超連結（沒有做手機版的作品則在手機瀏覽的時候 display: none; ）<br />\n5.note &nbsp;RWD','12',100,4,5,'2016-09-05 00:00:00','2