但有改排法)<br />\n-黑色headerbar增加聯絡我們或立即報名(V)<br />\n-最下方新增表單，下方表單（行程頁系統帶入、或自選行程下拉(V)<br />\n預計出發日期（系統帶入、自選下拉單選月份）(V)<br />\n<br />\n國家頁<br />\n-需另外拉一個頁面出來(因為要做SEO)(V)<br />\n-展開banner可不可以一個小標一個說明字(V)<br />\n&nbsp; 簡述區有可能這麼多&quot;<span style=\"color:#FF0000\">國家地理雜誌評選全球必遊景點、米其林旅遊指南三星推薦，天主教徒的朝聖地。大文豪雨果曾讚嘆：聖米歇爾山是海上的金字塔，與埃及古夫金字塔並駕齊驅。</span>&quot;<br />\n-備註不用ICON(團體日期業也是依樣)(V)<br />\n-要加篩選日期(V)<br />\n-推薦必遊移到最下面(V)<br />\n<br />\n動態頁面<br />\n-框框徒先全彩在移過去再反黑(V)<br />\n<br />\n多新增一個感謝頁(V)<br />\n&nbsp;','19',100,16,13,'2016-10-14 00:00:00','2016-10-17 00:00:00',0,2,1),(67,14,528506,'(寰藝)綜合微調','1.圖稿下面改10/1號補貨5000組 &nbsp;PC &nbsp;Mobile<br />\n<span style=\"color:#008000\"><em>(Finished:已上傳雲端)</em></span><br />\n2.聯繫單某些尺寸性別會消失&nbsp; <span style=\"color:#008000\"><em>(Finished，已上傳供測試)<br />\n(客戶提供OPPO F1會出現問題)</em></span><br />\n4信件裡的第一張圖問貴停在哪修文案&nbsp;<br />\n<span style=\"color:#008000\"><em>(待客戶回復: 第一頁廣告審核中，未來若需要新增會在聯絡我們˙放在網站上)</em></span><br />\n7.生日格式化<span style=\"color:#008000\"><em>(Finished，已上傳供測試)</em></span><br />\n6.聯繫單excel匯入匯出<span style=\"color:#008000\"><em>(Finished，已上傳)</em></span><br />\n5.填聯繫單時，有重複電話的話~要送錯誤訊系<span style=\"color:#008000\"><em>(Finished，已上傳)</em></span><br />\n3.非會員訂單改訂單成立會有錯誤訊息<span style=\"color:#008000\"><em>(Finished，已上傳)</em></span><br />\n-----------------------------------------------------------------<br />\n<br />\n<br />\n<br />\n<br />\n&nbsp;','18',100,8,17,'2016-10-07 00:00:00','2016-10-12 00:00:00',0,2,1),(68,5,528505,'(幻域)10/08開會修改項目','幻域開會修改項目<br />\n-訂單彈跳視窗<br />\n-及時編輯(筆)<br />\n-訂單拉出全新一頁','17',0,32,0,'2016-10-11 00:00:00','2016-10-14 00:00:00',0,0,1),(69,10,528509,'(君琦)手機板選單問題+動畫問題','補軍琦修改時數','20',100,0,7,'2016-10-04 00:00:00','2016-10-04 00:00:00',0,2,1),(70,10,528509,'(君琦)修改客戶需求','<span style=\"color:#0000FF\">20161011補工作時數</span>','20',100,0,4,'2016-10-06 00:00:00','2016-10-06 00:00:00',0,2,1),(71,4,528506,'(外匯網)調整聯繫單+動畫構想整理','<span style=\"color:#0000FF\">20161011 將工作日誌上時間加入</span>','19',100,0,10,'2016-10-05 00:00:00','2016-