 />\n<br />\n微風雨露<br />\n-這頁要改，原本想說今天跟他們一起討論<br />\n&nbsp;但根本沒講什麼....<br />\n<br />\n總監說沒有太大問題，但感覺太過於年輕，這個你看看有沒有辦法修，可以先從顏色下手，沒有也沒關西<br />\n<br />\n&nbsp;','19',100,8,12,'2016-10-28 00:00:00','2016-10-28 00:00:00',0,2,1),(107,1,528506,'(日月光)圖稿修改','<br />\n-微風雨露 &nbsp;手往上移 &nbsp;手的角度轉一下 自也往上移一點 &nbsp;<span style=\"color:#008000\"><em>-finshed</em></span><br />\n-守護大地左邊條亮&nbsp;<span style=\"color:#008000\"><em>finshed</em></span><br />\n-footer &nbsp;新聞最前線 跟活動 &nbsp;變成 &nbsp;消息及活動&nbsp;<span style=\"color:#008000\"><em>finshed</em></span><br />\n&nbsp;&nbsp; &nbsp; 嚴選出版電子報取消<br />\n&nbsp;&nbsp; &nbsp; 擁抱進草改成微風雨露<br />\n<br />\n-關於我們 &nbsp;宗旨文章重新排版左邊太重&nbsp;<span style=\"color:#008000\"><em>finshed</em></span><br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; 董監事 董事沒有分大小 全部排出來~<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"color:#008000\">文字排版置中&nbsp;<em>finshed</em></span><br />\n圍繞著大董去排~點進去才看到內容<span style=\"color:#008000\"><em>finshed</em></span><br />\n&nbsp;','19',0,4,4,'2016-11-01 00:00:00','2016-11-01 00:00:00',0,2,1),(108,5,528509,'(幻域補)點擊事件','補工作日誌上面時間<br />\n<br />\n點擊事件','20',100,1,1,'2016-10-19 00:00:00','2016-10-19 00:00:00',0,2,1),(109,5,528509,'(幻域補)幻域前端手機板修改','手機版修改','20',0,2,2,'2016-10-21 00:00:00','2016-10-21 00:00:00',0,2,1),(110,1,528509,'(日月光)首頁圖片更換','首頁圖片更換','20',100,1,1,'2016-10-21 00:00:00','2016-10-21 00:00:00',0,2,1),(111,1,528509,'(日月光)嚴選出版~守護大地~微風語露~內頁 PC版','-嚴選出版<br />\n-守護大地<br />\n-微風雨露<br />\n-內頁(嚴選出版)<br />\n<br />\nPC版RWD完成','12',0,8,8,'2016-11-07 00:00:00','2016-11-07 00:00:00',0,2,1),(112,1,528509,'(日月光)微風雨露PC版','完成微風與路PC版含RWD<br />\n&nbsp;','12',0,8,8,'2016-11-08 00:00:00','2016-11-08 00:00:00',0,2,1),(113,1,528509,'(日月光)5主題手機板','4種主題手機板的版型做全部都一樣~除了嚴選出版<br />\n<br />\n-焦點訊息<br />\n-守護大地<br />\n-微風雨露<br />\n-綠色學院<br />\n-文藝扎根<br />\n-嚴選出版(輪播)<br />\n<br />\n<br />\n&nbsp;','12',0,8,8,'2016-11-09 00:00:00','2016-11-09 00:00:00',0,2,1),(114,1,528509,'(日月光)關於我們+內頁mobile','-關於我們PC版完成<br />\n-內頁的mobile完成'